</style><style type="text/css" data-vite-dev-id="C:/Users/mj.vanstaden/Development/VASTech/vue-version-manager/version-manager/src/components/Login_Header.vue?vue&amp;type=style&amp;index=0&amp;lang.css">
.header {
  overflow: hidden;
  background-color: #6c6e27;
  padding: 2px 2px;
}

/* Style the header links */
.header a {
  float: left;
  color: white;
  text-align: center;
  padding: 12px;
  text-decoration: none;
  font-size: 18px;
  line-height: 25px;
  border-radius: 4px;
}

/* Style the logo link (notice that we set the same value of line-height and font-size to prevent the header to increase when the font gets bigger */
.header a.logo {
  font-size: 25px;
  font-weight: bold;
}

/* Change the background color on mouse-over */
.header a:hover {
  border-radius: 10px;
}
.login_header_right_option:hover {
  
  border-radius: 20px;
  background-color: #dddddd6a;
  color: black;
}

/* Style the active/current link*/
.header a.active {
  background-color: dodgerblue;
  color: white;
}

/* Float the link section to the right */
.header-right {
  float: right;
  display: flex;
  align-items: center;
  color: white;
}
.header-left {
    float: left;
    display: flex;
    align-items: center;
    justify-content: center;
    padding: 12px;
    text-decoration: none;
    font-size: 26px;
    line-height: 25px;
    border-radius: 4px;
    color: white;
    margin-left: 20px;
}
.header-left p {
    margin-bottom: -2px;
    padding-left: 10px;
}

/* Add media queries for responsiveness - when the screen is 500px wide or less, stack the links on top of each other */
@media screen and (max-width: 500px) {
.header a {
    float: none;
    display: block;
    text-align: left;
}
.header-right {
    float: none;
}
}

  animation: sk-bounce 2s infinite cubic-bezier(0.455, 0.03, 0.515, 0.955);
}

.ve-loading-bounce-dot:nth-child(2) {
  animation-delay: -1s;
}

@keyframes sk-bounce {
  0%,
  100% {
    transform: scale(0);
  }
  45%,
  55% {
    transform: scale(1);
  }
}

.ve-loading-wave {
  display: flex;
  justify-content: space-between;
}

.ve-loading-wave-rect {
  height: 100%;
  width: 15%;
  animation: sk-wave 1.2s infinite ease-in-out;
}

.ve-loading-wave-rect:nth-child(1) {
  animation-delay: -1.2s;
}

.ve-loading-wave-rect:nth-child(2) {
  animation-delay: -1.1s;
}

.ve-loading-wave-rect:nth-child(3) {
  animation-delay: -1s;
}

.ve-loading-wave-rect:nth-child(4) {
  animation-delay: -0.9s;
}

.ve-loading-wave-rect:nth-child(5) {
  animation-delay: -0.8s;
}

@keyframes sk-wave {
  0%,
  40%,
  100% {
    transform: scaleY(0.4);
  }
  20% {
    transform: scaleY(1);
  }
}

.ve-loading-pulse {
  width: var(--sk-size);
  height: var(--sk-size);
  background-color: var(--sk-color);
  border-radius: 100%;
  animation: sk-pulse 1.2s infinite cubic-bezier(0.455, 0.03, 0.515, 0.955);
}

@keyframes sk-pulse {
  0% {
    transform: scale(0);
  }
  100% {
    transform: scale(1);
    opacity: 0;
  }
}

.ve-loading-flow {
  width: calc(var(--sk-size) * 1.3);
  height: calc(var(--sk-size) * 1.3);
  display: flex;
  justify-content: space-between;
}

.ve-loading-flow-dot {
  width: 25%;
  height: 25%;
  background-color: var(--sk-color);
  border-radius: 50%;
  animation: sk-flow 1.4s cubic-bezier(0.455, 0.03, 0.515, 0.955) 0s infinite both;
}

.ve-loading-flow-dot:nth-child(1) {
  animation-delay: -0.3s;
}

.ve-loading-flow-dot:nth-child(2) {
  animation-delay: -0.15s;
}

@keyframes sk-flow {
  0%,
  80%,
  100% {
    transform: scale(0.3);
  }
  40% {
    transform: scale(1);
  }
}

.ve-loading-grid {
  /* Cube positions
     * 1 2 3
     * 4 5 6
     * 7 8 9
     */
}

.ve-loading-grid-cube {
  width: 33.33%;
  height: 33.33%;
  background-color: var(--sk-color);
  float: left;
  animation: sk-grid 1.3s infinite ease-in-out;
}

.ve-loading-grid-cube:nth-child(1) {
  animation-delay: 0.2s;
}

.ve-loading-grid-cube:nth-child(2) {
  animation-delay: 0.3s;
}

.ve-loading-grid-cube:nth-child(3) {
  animation-delay: 0.4s;
}

.ve-loading-grid-cube:nth-child(4) {
  animation-delay: 0.1s;
}

.ve-loading-grid:nth-child(5) {
  animation-delay: 0.2s;
}

.ve-loading-grid-cube:nth-child(6) {
  animation-delay: 0.3s;
}

.ve-loading-grid-cube:nth-child(7) {
  animation-delay: 0s;
}

.ve-loading-grid-cube:nth-child(8) {
  animation-delay: 0.1s;
}

.ve-loading-grid-cube:nth-child(9) {
  animation-delay: 0.2s;
}

@keyframes sk-grid {
  0%,
  70%,
  100% {
    transform: scale3D(1, 1, 1);
  }
  35% {
    transform: scale3D(0, 0, 1);
  }
}
